import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButtons, IonButton, IonIcon, IonMenuButton, IonBackButton } from '@ionic/react';
import React from 'react';
import QRComponent from '../components/QRComponent';
import './QRPage.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar mode="ios" color="light">
          <IonButtons slot="start">
            <IonMenuButton autoHide={false} color="primary" />
          </IonButtons>
          <IonTitle>أبشر</IonTitle>
          <img slot="end" alt="logo" id="header_logo" height="40" float-left src="assets/image/logo.png" />
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <QRComponent />
      </IonContent>
    </IonPage>
  );
};

export default Home;
